INSERT INTO `eh_communities` (`id`, `uuid`, `city_id`, `city_name`, `area_id`, `area_name`, `name`, `alias_name`, `address`, `zipcode`, `description`, `detail_description`, `apt_segment1`, `apt_segment2`, `apt_segment3`, `apt_seg1_sample`, `apt_seg2_sample`, `apt_seg3_sample`, `apt_count`, `creator_uid`, `operator_uid`, `status`, `create_time`, `delete_time`, `integral_tag1`, `integral_tag2`, `integral_tag3`, `integral_tag4`, `integral_tag5`, `string_tag1`, `string_tag2`, `string_tag3`, `string_tag4`, `string_tag5`, `community_type`, `default_forum_id`, `feedback_forum_id`, `update_time`, `namespace_id`, `area_size`) VALUES
	(240111044331051300, '15deff9e-0c85-11e6-adde-00163e005fce', 14956, '深圳市', 14957, '福田区', '深业花园', '深业花园', '深圳市福田区福中路106号', NULL, '深业花园是深业控股有限公司和深业集团（深圳）有限公司开发建设的园林式智能化高尚住宅小区，位于深圳市福田中心区东北片，东邻彩田北路、西邻海田路、南邻福中路、北面与中银花园一路之隔。深业花园由5栋楼高12层和5栋楼高22～30层主建筑组成，另设有楼高3层的会所和幼儿园各一栋。停车库设在地下，实行人车分流。小区的配套设施完善，布局合理，10栋住宅楼沿周边布置和首层架空6米，构成一个2万多平方米的园林绿地和庭园大空间。', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 682, 1, 212500, 2, '2016-04-27 14:34:01', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 179900, 179901, '2016-04-27 14:34:01', 999992, 136767),
	(240111044331051301, '0afc778b-0c87-11e6-adde-00163e005fce', 14956, '深圳市', 14957, '福田区', '岭秀名苑', '岭秀名苑', '深圳市福田区青岭二路', NULL, '小区2004年7月入伙，由两座连体的高层塔楼组成住户342户，地面33层、地下一层为停车场', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 342, 1, 212500, 2, '2016-04-27 14:48:02', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 179900, 179901, '2016-04-27 14:48:02', 999992, 27204),
	(240111044331051302, '10f8f9ac-0c87-11e6-adde-00163e005fce', 14956, '深圳市', 14958, '罗湖区', '深发花园', '深发花园', '深圳市罗湖区深南东路1013-1015号', NULL, '深发花园是由深业集团（深圳）有限公司负责开发兴建的高层商住大厦，位于深圳特区繁华的深南东路，1992年动工兴建，于1994年12月竣工入伙。深发花园由成发阁和恒发阁两座32层高的塔楼组成，占地面积为5980平米，总建筑面积为41400平米，停车场面积1500平米，共计有停车位45个，绿化面积2900平米，占商住区占地面积48.5%，花红草绿，曲径回环，布局合理。', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 482, 1, 212500, 2, '2016-04-27 14:48:12', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 179900, 179901, '2016-04-27 14:48:12', 999992, 42400),
	(240111044331051303, '140a67cb-0c87-11e6-adde-00163e005fce', 14956, '深圳市', 14957, '福田区', '风临左岸', '风临左岸', '深圳市福田区农林路53号', NULL, '风临左岸是深业鸿基南方（集团）有限公司开发建设的园林式智能化高尚住宅小区，位于深圳市福田农林路与深南市场交汇处。风临左岸由3栋组成，A栋3个单元楼高18层，B栋1个单元楼高24层，C栋2个单元楼高18层。方型顶层，外观色调优雅，区中心有大面积绿化带，加上竹林小溪绿地等。停车场设在地下，小区的配套设施完善，布局合理，3栋住宅楼沿周边布置和首层架空6米，构成一个1.5万多平方米的园林绿地和庭院大空间。', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 423, 1, 212500, 2, '2016-04-27 14:48:17', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 179900, 179901, '2016-04-27 14:48:17', 999992, 54167),
	(240111044331051304, '2ef44f15-74d5-11e6-adde-00163e005fce', 14956, '深圳市', 14958, '罗湖区', '深业中心大厦', '深业中心大厦', '深圳市罗湖区深南东路5045号', NULL, '深业中心大厦地处深南大道的金融中心区，是由深业中心发展（深圳）有限公司投资开发的5A智能化高级写字楼。大厦总建筑面积73542M2，总高33层 155米，深圳证券交易所入驻其中，决定其具有极其特殊的地位和影响。大厦建立了准军事化的保安队伍，人防、技防相结合的防范网络，以及与派出所和其它小区保安队形成的快速反应体系。根据《全国城市物业管理大厦考核标准》，结合金融机构的运作特点和星级酒店服务要求，形成了独具特色的金融商厦管理模式。1998年被建设部授予"全国物业管理示范大厦"称号，1999年"全国物业管理工作会议"指定为高层写字楼参观点，建设部部长俞振声高度评价为"点睛之作"。', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 682, 1, 212500, 2, '2016-09-07 08:29:24', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 179900, 179901, '2016-09-07 08:29:24', 999992, 73542);
