	(185040, 'b80cc73b-9856-4ee8-a795-c2aff36a13bd', 2, 179900, 0, 212514, 'PM', 'USER', NULL, NULL, NULL, 0, 240111044331051303, NULL, 1001, '帖子/普通', 8285, 1, 0, 0, 9, '深业物业与左邻合作打造物业智能化', 'text/plain', NULL, NULL, 21, 66, '{"sourceType":1,"title":"深业物业与左邻合作打造物业智能化","coverUri":"http://content-1.zuolin.com:80/image/aW1hZ2UvTVRvMU56UTJNbVl3WVRSak1EZzJZVGMyTTJFek1UQXhPVGxrTW1FMFl6aGhaQQ?token=xUoYPX9p32GeJpU6QO6iKQDXfK0OEbwoxdf0YmeafI1P3x7xasKherN8DAA6CmzUje_LMI7geEo_B_IYnzhwymNwwPH_qaKrplJ713ZEMyA9cS6-7sVFgngJSraqy8ki","contentAbstract":"深业物业作为深业集团旗下的物业管理公司，是我国首批物业管理一级资质企业，经过二十几年的发展，经营广泛，管理项目遍布全国各地，涵盖政府机关、写字楼、住宅小区、工业园区等多种物业类型。顺应经济技术的发展，深业物业与左邻合作，借助“物业+互联网”的模式，建立移动物业管理服务平台深业物业APP，实现物业管理服务智能化。 ","content":"<p style=\\"margin-top: 20px; margin-bottom: 20px; padding: 0px; text-indent: 2em; color: rgb(26, 26, 26); font-family: &#39;Microsoft YaHei&#39;, SimHei; font-size: 14px; line-height: 34px; white-space: normal;\\">近日，深业物业携手左邻构建的移动物业管理服务平台深业物业APP将正式发布上线。</p><p style=\\"margin-top: 20px; margin-bottom: 20px; padding: 0px; text-indent: 2em; color: rgb(26, 26, 26); font-family: &#39;Microsoft YaHei&#39;, SimHei; font-size: 14px; line-height: 34px; white-space: normal;\\">深业物业作为深业集团旗下的物业管理公司，是我国首批物业管理一级资质企业，经过二十几年的发展，经营广泛，管理项目遍布全国各地，涵盖政府机关、写字楼、住宅小区、工业园区等多种物业类型。顺应经济技术的发展，深业物业与左邻合作，借助“物业+互联网”的模式，建立移动物业管理服务平台深业物业APP，实现物业管理服务智能化。&nbsp;</p><p style=\\"margin-top: 20px; margin-bottom: 20px; padding: 0px; text-indent: 2em; color: rgb(26, 26, 26); font-family: &#39;Microsoft YaHei&#39;, SimHei; font-size: 14px; line-height: 34px; white-space: normal;\\">深业物业此次信息智能化建设涵盖物业内部管控和社区业主服务两大版块。其中物业内部管控包含企业OA系统和物业现场移动系统。一方面，通过增加移动审批、移动考勤和视频会议等移动办公功能，优化完善深业物业现有OA系统，帮助公司提升人力资源管理和物料管理水平，例如利用左邻视频会议系统，解决物业项目分散各地，无法集中开会和培训的问题；另一方面，通过使用移动品质巡查系统、移动设备管理系统和移动维修调度系统，进一步提升深业物业的现场服务品质和效率。深业物业将通过平台实现移动办公和标准化程序管理，降低运营成本，提高运营效率。</p><p style=\\"margin-top: 20px; margin-bottom: 20px; padding: 0px; text-indent: 2em; color: rgb(26, 26, 26); font-family: &#39;Microsoft YaHei&#39;, SimHei; font-size: 14px; line-height: 34px; white-space: normal;\\">而在社区业主服务方面，深业物业将通过平台向业主提供停车充值、物业报修、缴费、投诉建议等物业基础服务，同时也提供智能门禁、社区电商、公共服务预约等增值服务。此外，深业物业将在平台的基础上，建立业主服务门户，进一步为业主提供养老、保险、教育、打车等与业主生活息息相关的其它服务，打造社区服务产业链。</p><p style=\\"margin-top: 20px; margin-bottom: 20px; padding: 0px; text-indent: 2em; color: rgb(26, 26, 26); font-family: &#39;Microsoft YaHei&#39;, SimHei; font-size: 14px; line-height: 34px; white-space: normal;\\">随着移动终端技术和物联网的日渐普及，物业管理服务的创新升级在技术层面愈发成熟，深业物业以“做最值得托付的物业服务集成商”为愿景，秉承“提升深业品牌形象，让客户真切感受服务的价值，让员工与企业共同成长”的使命，携手左邻，积极探索，为移动互联时代物业管理模式树立又一面新旗帜。</p><p><br/></p>","contentType":"create"}', 1, NULL, 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, '2016-06-01 14:58:56', '2016-06-01 14:58:56', 0, NULL, NULL, NULL, NULL, 0, 1, NULL, 0, 0),
