	(190718, '2b03e128-f865-4350-b881-3ed9edfaa8f3', 2, 179900, 0, 212500, 'PM', 'USER', NULL, NULL, NULL, 0, 240111044331051304, NULL, 1003, '帖子/公告', 13888, 0, 0, 1, 54, '#公告#关于召开深业物业第三届读书月活动启动仪式的通知', 'text/plain', '各职能部门、管理处、分公司：\n    公司定于11月4日（周五，与办公例会同一日）下午召开深业物业第三届读书月活动启动仪式。具体安排如下：\n1、活动时间：11月4日，下午14:00-16:30\n2、参加对象：公司领导、职能部门负责人、广东省内项目负责人及员工代表（具体名单附后）\n3、地点：公司培训室\n4、主要内容：\n（1）徐作成总经理致辞；\n（2）领导赠书；\n（3）各单位捐书\n（4）名画鉴赏讲座。\n  外请讲师：陈濯非\n 5、其他\n（1）开幕式有捐书仪式，请各项目收集好业主/客户的捐书，带到开幕式现场进行捐书；\n（2）请参加人员于11月4日下午13:50到公司会议室签到。\n（2）请参加人员穿夏装工服出席。\n附：人员名单\n王荣晖、徐作成、苗忠、廖文杰、刘黎、李忠霖、文科\n肖迎春、李征、刘子路、黄护国、潘英超、左春玲、徐波、洪权\n彭吉祥、张瑛、杨树清、黎锐、刘恕林、邓洪、熊蔺蓉、张玮、陈玉槽、许凤莲、肖汉龙、吴海康、赵治军、王姝、汪迪、杨涛、晏小辉、黄琪、许华东、魏兴权、姚卫平、左康军、钟世军、张柱成、杨秉炎、王群、薛峰、张文杰、廖国松、邵丽娜、刘震、庄斌、赵光明\n通讯员代表：秦小明、李靖娴、王兆虎、吕汉贤、李金阳、陈振祥、韩冬、王晓丹\n视频会议名单：\n长沙分公司：谭双、贺荣斌、陈继文、徐海涛（组织分公司员工尽量参加）\n南京分公司：吴影雯、唐国华、华纯（组织分公司员工尽量参加）\n江西分公司：欧阳钧、曾平原、孙洪禄（组织分公司员工尽量参加）\n\n深业集团(深圳)物业管理有限公司\n二0一六年十月三十一日\n\n', NULL, NULL, NULL, NULL, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2, '2017-01-19 00:53:26', '2016-11-02 09:34:34', 0, NULL, NULL, '2016-11-02 00:00:00', '2016-11-30 00:00:00', 0, 1, NULL, 0, 0),
